using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// A UIStoryboardSegue object is responsible for performing the visual transition between two view controllers. In addition, segue objects are used to prepare for the transition from one view controller to another. Segue objects contain information about the view controllers involved in a transition. When a segue is triggered, but before the visual transition occurs, the storyboard runtime calls the current view controller’s prepareForSegue:sender: method so that it can pass any needed data to the view controller that is about to be displayed.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIStoryboardSegue_Class/index.html#//apple_ref/occ/cl/UIStoryboardSegue"/>    [iOSVersion(5)]    [Export("")]    public class UIStoryboardSegue : NSObject//, AnyObject, CVarArgType, Equatable, Hashable, NSObjectProtocol, Printable    {        public UIStoryboardSegue() { }        /// <summary>        /// Performs the visual transition for the segue.        /// </summary>        [iOSVersion(5)]        [Export("perform")]        public virtual void Perform() {  }                /// <summary>        /// Creates a segue that calls a block to perform the segue transition.        /// </summary>        /// <param name="identifier">The identifier you want to associate with this particular instance of the segue. You can use this identifier to differentiate one type of segue from another at runtime.</param>        /// <param name="source">The view controller visible at the start of the segue.</param>        /// <param name="destination">The view controller to display after the completion of the segue.</param>        /// <param name="performHandler">A block to be called when the segue’s perform method is called.</param>        [iOSVersion(6)]        [Export("convenience init")]        public UIStoryboardSegue([Optional] string identifier, UIViewController source, UIViewController destination, Action performHandler) { }                /// <summary>        /// The source view controller for the segue. (read-only)        /// </summary>        [iOSVersion(5)]        [Export("sourceViewController")]        public AnyObject SourceViewController { get; private set; }                /// <summary>        /// The destination view controller for the segue. (read-only)        /// </summary>        [iOSVersion(5)]        [Export("destinationViewController")]        public AnyObject DestinationViewController { get; private set; }                /// <summary>        /// The identifier for the segue object. (read-only)        /// </summary>        [iOSVersion(5)]        [Export("identifier")]        [Optional]        public string Identifier { get; private set; }    }}